import { NavLink } from "react-router-dom";
import YearEdition from "./YearEdition";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

export const Editions = () => (
	<div>
		<h2>Les précédentes éditions</h2>

		<section>

			<YearEdition year="2020" theme="Le temps" />
			<YearEdition year="2019" theme="Les jeux" />
			<YearEdition year="2018" theme="Les romans" />
			<YearEdition year="2017" theme="Les faits divers" />
			<YearEdition year="2016" theme="Le luxe" />

		</section>

		<nav>
			<NavLink to="/"> <button> <FontAwesomeIcon icon="arrow-left" /> Retour</button> 			</NavLink>
		</nav>
    </div>
);

export default Editions;
